import React from "react";

const Welcome = () => {
  return <h1>Welcome</h1>;
};
const GoodBye = () => {
  return <h1>GoodBye</h1>;
};

const ConditionalRendering = () => {

    //Conditional / 
  if (true) {
    <Welcome />;
  } else {
    <GoodBye />;
  }
};

export default ConditionalRendering;
